  {
    name: "P.T in Cardio-thoratic Surgery",
    theoryMax: 100,
    theoryMin: 50,
    theorySecured: '',
    practicalMax: 50,
    practicalMin: 25,
    practicalSecured: '',
    totalMax: 150,
    totalMin: 75,
    result: 'Pass'
  },
  {
    name: "Rehabilation Medicinessssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssss",
    theoryMax: 100,
    theoryMin: 50,
    theorySecured: '',
    practicalMax: 50,
    practicalMin: 25,
    practicalSecured: '',
    totalMax: 150,
    totalMin: 75,
    result: 'Pass'
  }
];

// Functional component to render the form
const BPT7Semester = () => {
  return (
    <FormComponentBPT
      title="7 Semester Final Examination (BPT)"
      subjectsData={subjectsData}
    />
  );
};

export default BPT7Semester ;
